    # d为每个简单题的难度，等于每个简单题的挑战级别
    # 这里用指针方法，节省内存开销
    d = [a for a in d]
    dp = [[0 for _ in range(2)] for _ in range(N)]
    dp[0][0] = 1
    dp[0][1] = 1

    for i in range(1, N):
        # 下一个简单题的挑战级别
        d[i] = max(d[i], d[i-1])
        # 选择哪个挑战级别
        if d[i] <= d[i] % 2 + 1:
            dp[i][0] = dp[i-1][0] + 1
        else:
            dp[i][0] = dp[i-1][1] + 1
        # 选择哪个挑战级别
        if d[i] <= d[i] % 2 + 1:
            dp[i][1] = dp[i-1][0] + 1
        else:
            dp[i][1] = dp[i-1][1] + 1

    return str(dp[N-1][0] + dp[N-1][1] - 1)

