    def DFS(i: int, j: int) -> None:
        if 0 <= i < num_lines and 0 <= j < num_cols and grid[i][j] == ".":
            grid[i][j] = "#"
            DFS(i + 1, j)
            DFS(i - 1, j)
            DFS(i, j + 1)
            DFS(i, j - 1)

    # Start DFS from each black square
    for i in range(num_lines):
        for j in range(num_cols):
            if grid[i][j] == "#":
                DFS(i, j)
    # Find black squares
    black_squares = 0
    for i in range(num_lines):
        for j in range(num_cols):
            if grid[i][j] == "#":
                black_squares += 1
    # Remove row
    for i in range(num_lines):
        for j in range(num_cols):
            if grid[i][j] == ".":
                grid.pop(i)
                grid.insert(i, ["." for _ in range(num_cols)])
    # Remove col
    for j in range(num_cols):
        for i in range(num_lines):
            if grid[i][j] == ".":
                for k in range(num_lines):
                    grid[k].pop(j)
                    grid[k].insert(j, ".")
    # Find black squares
    for i in range(num_lines):
        for j in range(num_cols):
            if grid[i][j] == "#":
                black_squares += 1
    # Output grid
    return "\n".join(["".join(row) for row in grid])

