    def find_min(arr: List[int]) -> int:
        return max(arr)

    def find_max_per_child(arr: List[int]) -> int:
        return sum(arr)

    def dp(arr: List[int]) -> int:
        min_size = find_min(arr)
        max_per_child = find_max_per_child(arr)

        max_num_of_children = 0
        for i in range(len(arr)):
            if arr[i] >= min_size:
                max_num_of_children += 1

        # All children are satisfied
        if max_per_child >= min_size * max_num_of_children:
            return max_num_of_children

        # If only one child can be satisfied
        elif max_per_child >= min_size:
            return 1

        else:
            # If there is multiple children, we can combine two groups
            # For every number i in arr, we find the number j which can be combined
            for i in range(len(arr)):
                for j in range(i, len(arr)):
                    if arr[i] + arr[j] >= min_size * (max_num_of_children - 1):
                        return max_num_of_children - 1

        return max_num_of_children

    return dp(list(map(int, stdin.split(' '))))

