    def parse_molecule(molecule: str) -> (dict[str, int], int):
        """
        Returns a dictionary of atoms and the amount of times they appear and
        the number of atoms.
        """
        # dictionary of atoms and number of copies
        atoms = {}
        # variable to count how many atoms
        atom_count = 0
        for i, char in enumerate(molecule):
            if char.isupper():
                atom = molecule[i : i + 2]
                if atom.isalpha() and len(atom) == 2:
                    if atom in atoms:
                        atoms[atom] += 1
                    else:
                        atoms[atom] = 1
                    atom_count += 1
                else:
                    raise Exception("Invalid atom")
            elif char.isdigit():
                # increment the atom count by the number of copies in
                # the string
                atom_count += int(char)
            elif char.isalpha():
                raise Exception("Invalid atom")
        return atoms, atom_count

    def parse_output(output: str) -> (dict[str, int], int):
        """
        Returns a dictionary of atoms and the number of times they appear
        in the output, and the number of atoms in the output.
        """
        atoms = {}
        atom_count = 0
        for char in output:
            if char.isupper():
                atom = output[0 : 2]
                if atom.isalpha() and len(atom) == 2:
                    if atom in atoms:
                        atoms[atom] += 1
                    else:
                        atoms[atom] = 1
                    atom_count += 1
                else:
                    raise Exception("Invalid atom")
            elif char.isdigit():
                # increment the atom count by the number of copies in
                # the string
                atom_count += int(char)
            elif char.isalpha():
                raise Exception("Invalid atom")
        return atoms, atom_count

    # get input
    stdin, k = stdin.split("\n")
    k = int(k)
    stdin = stdin.split(" ")
    # parse molecules
    molecules = []
    for i in range(len(stdin) - 1):
        molecules.append(parse_molecule(stdin[i]))
    # if the amount of molecules is less than the amount of desired output,
    # we can't do anything
    if k > len(molecules):
        return str(0)
    # find all possible molecules in the output
    outputs = []
    for i in range(len(molecules)):
        # try all possible ways to combine molecules in the output
        for j in range(len(molecules)):
            # try all possible ways to combine molecules in the output
            for k in range(int(stdin[len(stdin) - 1]) + 1):
                # make output molecule
                output = stdin[i][0] * k + stdin[j][0] * (
                    int(stdin[len(stdin) - 1]) - k
                )
                # parse output
                outputs.append(parse_output(output))
    # sort outputs by the number of atoms in the output
    outputs = sorted(outputs, key=lambda x: x[1])
    # return the amount of desired output
    return str(outputs[-1][0][stdin[len(stdin) - 1]][1])

